  return (
    <>
      <h1>
        {isLoggedIn ? `${name} ${surname} (${age})` : "Giris yapmadiniz"}
      </h1>

      { 
        friends.map((friend, index)=>(
          <div key={index}>
            {index+1} {friend}
          </div>
        ))
      }
    </>
  );
}

export default User;
